【今日あなたは何着てる？】パリ在住のファッションデザイナー 島田順子さんにインタビュー。パリの魅力や若い世代へのメッセージについても聞いてみました。

島田順子は杉野学園ドレスメーカー女学院卒業後に渡仏。1981年にパリでJUNKO SHIMADA DESIGN STUDIOを設立し、同年パリと東京でコレクション発表しました。

